          #table-heading {
          padding-left: 10%;
          font-size: 14px;
          font-weight: bold;
          color: #9f9f9f;
          }
          .tb {
          border-collapse: collapse;
          table-layout: fixed;
          font-size: 12px;
          margin-bottom: 5%;
          margin-left: 10%;
          width: 80%;
          font-family: 'Segoe UI','Tahoma, Geneva, Verdana, sans-serif','Segoe UI Regular','Segoe UI';
          padding: 0;
          overflow-wrap: normal;
          }
          .tb tr:first-child{
          border-left: 1px solid #CCC;
          }
          .tb tr:last-child{
          border-right: 1px solid #CCC;
          }
          .tb th {
          text-align: left;
          background: #fff;
          border: 1px solid #CCC;
          color: #9f9f9f;
          text-transform: uppercase;
          font-size: 12px;
          font-family: 'Segoe UI','Tahoma, Geneva, Verdana, sans-serif','Segoe UI Regular','Segoe UI';
          height: 37px;
          padding-left: 11px;
          padding-right: 11px;
          overflow: hidden;
          }
          .tb td {
          height: 37px;
          text-align: left;
          background: #fff;
          padding-left: 11px;
          padding-right: 11px;
          border: 1px solid #CCC;
          overflow: hidden;
          }
          .tb tr:hover td {
          background-color:#ebebeb;
          }
          #time-heading {
          width: 200px;
          }
          #result-heading {
          width: 50px;
          }
          #priority-heading {
          width: 60px;
          }

    <script>
    (function () {
            function invokeOnAllElements(elements, functionToInvoke, argument) {
                Array.prototype.forEach.call(elements, function (el) {
                    functionToInvoke(el, argument);
                })
            }

            function setDisplay(el, newState) {
                el.style.display = newState ? '' : 'none';
            }

            function setExpandedState(el, newState) {
                el.isExpanded = newState;
            }

            function setDisplayAndExpandedState(el, newState) {
                setDisplay(el, newState);
                setExpandedState(el, newState);
            }

            function changeExpandButtonState(el, newState) {
                if (newState) {
                    el.classList.remove('collapsed-toggle-button');
                } else {
                    el.classList.add('collapsed-toggle-button');
                }
            }

            function changeRowAndButtonDisplay(el, newState) {
                setDisplayAndExpandedState(el, newState);
                var buttonElement = el.previousElementSibling.getElementsByClassName('toggle-button')[0];
                if (buttonElement) {
                    changeExpandButtonState(buttonElement, newState);
                }
            }

            function expandAllChildren(el, className) {
                var currentState = el.isExpanded;
                var currentElement = el.nextElementSibling;
                if (currentElement == null) {
                    return;
                }
                while (currentElement !== null) {
                    if (currentElement.className.indexOf(className) != -1) {
                        break;
                    }

                    changeRowAndButtonDisplay(currentElement, !currentState);
                    currentElement = currentElement.nextElementSibling;
                }

                el.isExpanded = !currentState;
            }

            function attachHandlerByClassNameWithExpandedState(className, eventName) {
                var elements = document.getElementsByClassName(className);
                invokeOnAllElements(elements, function (el) {
                    el.isExpanded = true;
                    el.addEventListener(eventName, function (ev) {
                        var eventTarget = ev.currentTarget;
                        expandAllChildren(eventTarget, className);
                    });
                });
            }

            function expandCollapseAll(className) {
                var elements = document.getElementsByClassName(className);
                invokeOnAllElements(elements, function (el) {
                expandAllChildren(el, className);
                });
            }

            attachHandlerByClassNameWithExpandedState('result', 'click');
            expandCollapseAll('result');
        })()
    </script>
